import {StyleSheet} from "react-native"

export default StyleSheet.create({
    body: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center'
      },
      headerLinha: {
        width: '90%',
        height: '10%',
        borderBottomWidth: 2,
      },
      image:{
        width: 130,
        height: 90,
        marginTop: "5%"
      },
})
